package main

import (
	"encoding/base64"
	"fmt"
	"image"
	"image/jpeg"
	"image/png"
	"log"
	"os"
	"strings"
)

const data = ``

func main() {
	base64Decoder(data)
}

//Given a base64 string of a JPEG or PNG, encodes it into an JPEG image test.jpg, or PNG image test.png
func base64Decoder(data string) {

	reader := base64.NewDecoder(base64.StdEncoding, strings.NewReader(data))
	m, formatString, err := image.Decode(reader)
	if err != nil {
		log.Fatal(err)
	}
	bounds := m.Bounds()
	fmt.Println("base64toJpg", bounds, formatString)
	switch formatString {
	case "png":
		//Encode from image format to writer
		pngFilename := "test.png"
		f, err := os.OpenFile(pngFilename, os.O_WRONLY|os.O_CREATE, 0777)
		if err != nil {
			log.Fatal(err)
			return
		}

		err = png.Encode(f, m)
		if err != nil {
			log.Fatal(err)
			return
		}
		fmt.Println("png file", pngFilename, "created")
	case "jpeg":
		//Encode from image format to writer
		pngFilename := "test.jpg"
		f, err := os.OpenFile(pngFilename, os.O_WRONLY|os.O_CREATE, 0777)
		if err != nil {
			log.Fatal(err)
			return
		}

		err = jpeg.Encode(f, m, &jpeg.Options{Quality: 100})
		if err != nil {
			log.Fatal(err)
			return
		}
		fmt.Println("jpg file", pngFilename, "created")

	}

}
